(281, 'sara', 'ramos', 'publicidad@gruporeinaldo.com', 'b6474086283eb7aa31486626439340f3', 'La Casa del Rey', '#FFFFFF', '', 'www.lacasadelreyestepona.com', '1,2', '', '+34:951:965414', 'undefined:undefined:undefined', 'no', 'no', '1,2,4', '1', '20', '29680', '2424', 'Calle Raphael nº7,,', '', 'En pleno casco antiguo de Estepona, junto a la Plaza de las Flores, y enmarcada dentro de una casa con más de 200 años de historia, La Casa del Rey es una“vinoteca – restaurante” que abrió sus puertas en 2012.\r\n\r\nEn La Casa del Rey solo trabajamos con productos de primera calidad para ofrecer un amplio surtido de pinchos del día con recetas innovadoras pero siempre respetando la cocina tradicional. En nuestra carta encontramos platos principales, pinchos, tostas y raciones para compartir.\r\n\r\nEn nuestra selección de vinos cuenta con más de 120 referencias de vino, 50 de ellas servidas por copa. ', '', 'merchant', 2, 'active', '5bbf188c54136', '', 'active', 'active', '2018-10-05 12:21:24', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15410525325bda98742c31d.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15392537615bbf260151282.jpg\",\"aboutus_image\":\"15410567785bdaa90a25b1b.jpg\"}', '2', '', 'custome', 'Img_Obs_15392532990.jpg,Img_Obs_15392532991.jpg,Img_Obs_15392534360.JPG,Img_Obs_15392534990.jpg,Img_Obs_15392535160.JPG,Img_Obs_15392537220.jpg,Img_Obs_15392537231.jpg,Img_Obs_15392537530.jpg', '{\"image0\":{\"name\":\"Img_Obs_15392532990.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"Img_Obs_15392532991.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"Img_Obs_15392534360.JPG\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"Img_Obs_15392534990.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"Img_Obs_15392535160.JPG\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"Img_Obs_15392537220.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"Img_Obs_15392537231.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"Img_Obs_15