(923, 'Juan Manuel', 'González', 'cafeconlibrosmalaga@yahoo.es', '', 'Café con Libros', '', '', 'http://cafeconlibrosmalaga.com/', '2,', '', '+34:952:215189', '', 'yes', 'yes', '1,2,4', '1', '20', '29012', '2417', 'Plaza de la Merced, 19,,', '', 'En plena Plaza de la Merced nos encontramos con una terraza con vistas, pero también un mágico lugar cuyo interior esta empapelado con estanterías y libros cuyo olor se mezcla con frutas exóticas.\r\n\r\nEl Café con Libros es precisamente eso, un café, allí puedes leer la prensa del día, un libro cualquiera incluso en ruso, mientras desayunas, disfrutas de un café o te deleitas con las especialidades que ofrecemos.\r\n\r\nPor eso es un sitio con cierta mágia, ya que hoy en día el estar tomando un café, un crepe o un sándwich con la posibilidad de elegir entre una gran variedad de libros, revistas o prensa es poco menos que un lujo.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15750453345de148d6a90fe.png\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15750453345de148d6a976a.png\",\"aboutus_image\":\"1575045602cafe_con_libros_about_us_a.png\"}', '3', '', 'custome', '15750453185de148c620318.png,15750453565de148ec328a4.png,15750455215de14991018a0.png,15750455395de149a36e407.png,15750476655de151f19d171.png,15750476835de15203d87a2.png,15750476955de1520f5ddc5.png,15750477265de1522ea4dd0.png,15750477525de15248c0c6e.png,157', '{\"image0\":{\"name\":\"15750453185de148c620318.png\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15750453565de148ec328a4.png\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15750455215de14991018a0.png\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15750455395de149a36e407.png\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15750476655de151f19d171.png\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"15750476835de15203d87a2.png\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"15750476955de1520f5