(1110, 'Jesús Manuel', 'García', 'jghcortador@gmail.com', '244fe426c4abbda26698c87ef5d5d720', 'Mesón Virgen de la Luz', '', '', '', '1,2', '', '+34:856:120158', '+34:606:314295', 'no', 'no', '1,2,4', '1', '19', '11300', '2379', 'Calle Carboneros, 29,,', '', 'Deliciosos platos caseros con un toque personal, que los hace totalmente diferentes y especiales.\r\n\'Manolo\', como sus amigos lo conocen, al mando en la cocina, es el encargado de que desde allí llegue hasta el paladar de sus comensales, a los que acoge como si de su propia familia se tratara, delicicosos manjares a los que difícilmente podrás resistirte una vez los hayas probado.\r\nMaestro jamonero desde hace ya más de 35 años y con una larga trayectoria en el mundo hostelero.\r\n\r\nPor nombrar algunas, entre sus especialidades podremos encontrar desde choco confitado, San Genaro, lomito uruguayo, o una deliciosa sopa de ajo hasta un espectacular Tataki de atún rojo al teriyaki.\r\n', '', 'merchant', 2, 'active', '5ce669a5ea0bf', '', 'active', 'active', '2019-05-22 03:50:38', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15721733425db5761e85348.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15721731135db5753962ffa.jpg\",\"aboutus_image\":\"1571822669virgen_de_la_luz3.jpg\"}', '1', '1558600823virgen de la luz 3.jpg.jpg', 'custome', '15586008465ce65c8e8061c.jpg,15586008525ce65c944b064.jpg,15586008605ce65c9c479ae.jpg,15586008715ce65ca752ede.jpg,15586008855ce65cb59a0c3.jpg,15718220065db019b6a1ec3.jpg,15718220325db019d069962.jpg,15718220545db019e65ce8b.jpg,15718220785db019fe8b494.jpg,157', '{\"image0\":{\"name\":\"15586008465ce65c8e8061c.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15586008525ce65c944b064.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15586008605ce65c9c479ae.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15586008715ce65ca752ede.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15586008855ce65cb59a0c3.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"