(1269, 'Nicolás', 'Foretic', 'growcafetarifa@gmail.com', 'ea0be14c2195fb8285c217fd5bb0cd3c', 'Grow Café', '', '', 'https://www.growcafe.es/es/', '1,2', '', '+34:956:682578', 'undefined:undefined:undefined', 'yes', 'yes', '1,2,4', '1', '19', '11380', '2389', 'Calle Alcalde Juan Núñez, 4,,', '', 'Nuestro gusto exigente y exquisito con la comida se ve reflejado en nuestros platos y la respuesta del público que los prueba. Buscando además que la alimentación sea consciente y sana. Por ello elaboramos casi todo en nuestra cocina y con productos de agricultura biológica. Nuestro proyecto tiene una visión de sostenibilidad y fomento de los valores humanos.\r\nVariedad en nuestros platos, ya sean para desayunar o comer.\r\nTambién contamos con una selección de productos ecológicos que se pueden encontrar en nuestra Tienda Bio.\r\nUbicación privilegiada con vistas al Estrecho de Gibraltar, al Puerto de Tarifa y Marruecos, todo acompañado de un espacio confortable decorado vintage. Todo un placer.\r\n\r\n\r\n', '', 'merchant', 2, 'active', '5da82a7e00d48', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"menu\":\"\",\"logo\":\"15921518945ee64f560ecd0.png\",\"cover_image\":\"15842919685e6e608011000.png\",\"aboutus_image\":\"1584292293grow_about.png\",\"events\":\"\"}', '1', '', 'custome', '15842921155e6e6113f2ba6.png,15842921285e6e61201a679.png,15842921405e6e612c160fa.png,15842921565e6e613c26160.png,15842921735e6e614d92084.png,15842921845e6e615867982.png,15842921935e6e6161d084d.png,15842922055e6e616d09cb9.png,15842922215e6e617d0513c.png,158', '{\"image0\":{\"name\":\"15842921155e6e6113f2ba6.png\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15842921285e6e61201a679.png\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15842921405e6e612c160fa.png\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15842921565e6e613c26160.png\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15842921735e6e614d92084.png\",\"title\":\"\",\"des\":\"\"}