(1420, 'Rodrigo', 'Solís Isorni', 'bardetapasdonbenito@gmail.com', 'c713ca401c63cb24db5c8027e6c078b9', 'Bar de Tapas Don Benito', '', '', '', '1,2', '', '+34:645:990923', '', 'yes', 'yes', '1,2,4', '1', '19', '11360', '2383', 'Plaza de Armas, 10,,', '', 'Bar de Tapas Don Benito es un negocio familiar de cocina tradicional andaluza, ubicado en la emblemática Plaza de Armas, junto a la iglesia de Santa María La Coronada, en San Roque.\r\nDisponemos de un variado menú y una extensa carta de vinos.\r\nEntre nuestros platos podemos destacar el queso de cabra envuelto en hojaldre con miel o el lomo de atún con salmorejo cordobés y caviar de aceite de oliva.\r\nEn Bar de tapas Don Benito utilizamos únicamente ingredientes frescos para la elaboración de nuestros exquisitos platos.\r\nGanador de varios premios gastronómicos.\r\nBuen ambiente e inmejorable ubicación.\r\n', '', 'merchant', 1, 'active', '5da82dc372372', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15902126185ec8b80a204ad.png\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15905640755ece14ebcf158.PNG\",\"aboutus_image\":\"1590212970don_benito_about_us.png\"}', '1', 'assets/frontend/images/cover-image/tapas_banner.jpg', 'custome', '15692261335d887d95729cb.jpg,15692261445d887da0dd15b.jpg,15692261545d887daacbfa7.jpg,15692261635d887db36ea25.jpg,15692261735d887dbd834d1.jpg,15692261825d887dc6c817e.jpg,15692261935d887dd19b01f.jpg,15692262055d887ddd79f9b.jpg,15692262855d887e2dba0ad.jpg,159', '{\"image0\":{\"name\":\"15692261335d887d95729cb.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15692261445d887da0dd15b.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15692261545d887daacbfa7.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15692261635d887db36ea25.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15692261735d887dbd834d1.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"15692261825d887dc6c817e.jpg\",\"title\":\"\",\"des\":\"\"