(1423, 'Yolanda', 'Marín', 'yomabai89@gmail.com', 'da34d1d48ff246a5bbf4a914a65ba567', 'Tapería Enzo', '', '', '', '2,3', '', '+34:642:940818', '', 'yes', 'yes', '1,2,3,4', '1', '19', '11201', '2374', 'Calle Alfonso XI, 15,,', '', 'Tapería Enzo, en el centro de Algeciras, y regentada por una jóven pareja de emprendedores, es un lugar donde cada tapa está elaborada con productos nacionales y de temporada. Todos sus platos se cocinan al momento de ser pedidos, lo que también garantiza su frescura.\r\nCocina innovadora y adaptada al gusto del consumidor, ya que el lugar se caracteriza por querer atender a las exigencias  y gustos de sus clientes en la medida de lo posible.\r\nUna manera distinta de enteder la tapa, algo tan característico de nuestro país.\r\nMuy buen trato al público y servicio inmejorable.\r\n\r\n', '', 'merchant', 2, 'active', '5e66664495e6a', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15898283365ec2daf0513d6.png\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15708691905da18fc6020a3.jpg\",\"aboutus_image\":\"1570874904enzo_about_us.jpg\"}', '1', '', 'custome', '15904244325ecbf370a4c3f.jpg,15904244475ecbf37f791d8.jpg,15904244785ecbf39e493fb.jpg,15904245055ecbf3b90e50f.jpg,15904245175ecbf3c5686d1.jpg,15904245455ecbf3e110dfe.jpg,15904245615ecbf3f11254a.jpg,15904245795ecbf40307835.jpg,15908254195ed211cb83ce7.jpg,159', '{\"image0\":{\"name\":\"15904244325ecbf370a4c3f.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15904244475ecbf37f791d8.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15904244785ecbf39e493fb.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15904245055ecbf3b90e50f.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15904245175ecbf3c5686d1.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"15904245455ecbf3e110dfe.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"15904245615ecbf3f11254a.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"1