(1424, 'Francisco Javier', 'Pérez', 'elvagonplazaalta@gmail.com', '512f6e73bebcf729ea83bf1280bd728e', 'El Vagón Bar de Tapas', '', '', '', '2,', '', '+34:956:655160', '', 'yes', 'yes', '1,2,4', '1', '19', '11201', '2374', 'Plaza Alta, 12,,', '', 'El Vagón es un tradicional bar de tapas situado en La Plaza Alta de Algeciras, una de las zonas más emblemáticas de la ciudad.\r\n\r\nSu cocina tradicional española con aires mediterráneos y la utilización de productos de temporada para la elaboración de todos y cada uno de sus platos, hace que visitar este lugar se convierta en algo imprescindible si pasas por aquí.\r\n\r\nExcelente trato al público y muy buena relación calidad-precio.', '', 'merchant', 1, 'active', '5da82e004099d', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15708911655da1e59d2e7dc.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15708911655da1e59d2ec93.jpg\",\"aboutus_image\":\"1570891165el_vagon_about_us.jpg\"}', '1', '', 'custome', '15708906975da1e3c9708b5.jpg,15708907075da1e3d36ad32.jpg,15708907155da1e3db59699.jpg,15708907235da1e3e371eac.jpg,15708907315da1e3ebc6a64.jpg,15708907465da1e3fa11449.jpg,15708907545da1e4029b671.jpg,15708907655da1e40db2438.jpg,15708907785da1e41ae9d74.jpg,157', '{\"image0\":{\"name\":\"15708906975da1e3c9708b5.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15708907075da1e3d36ad32.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15708907155da1e3db59699.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15708907235da1e3e371eac.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15708907315da1e3ebc6a64.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"15708907465da1e3fa11449.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"15708907545da1e4029b671.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"15708907655da1e40db2438.jpg\",\"title\":\"\",\"des\":\"\"},\"image8\":{\"name\":\"15708907785da1e41ae9d74.jpg\",\"title\":\"\",\"des