(1446, 'Irene', 'Castillo Sotorrio', 'veganeriadelsur@gmail.com', '', 'Veganería del sur', '', '', 'https://veganeriadelsur.com/', '3,', '', '+34:654878664', '', 'no', 'no', '1,2,4', '1', '20', '29001', '2417', ',,', '', 'Somos un catering original, saludable y ético.\r\nVeganería del Sur nace para satisfacer la creciente demanda de quienes reclaman una alimentación diferente, con productos frescos, vegetales e innovadores.\r\nEn nuestra cocina no entran conservantes, productos transgénicos o de calidad dudosa. Diseñamos nuestros menús teniendo en cuenta tus necesidades nutritivas y tu salud, sin olvidarnos de la calidad y del sabor. Pero además, nos diferenciamos del resto de caterings porque somos 100% vegetales: queremos darte a conocer las maravillas de la cocina vegana, una gastronomía sorprendente que respeta no sólo a las personas sino al resto de animales que conviven con nosotros en este planeta.\r\nEventos de empresa, celebraciones, productos para negocios de hostelería...estamos a tu entera disposición.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15749509175ddfd805c2678.png\",\"cover_image\":\"15749507355ddfd74f140c6.png\",\"aboutus_image\":\"1574950330veganer\\u00eda_sobre_nosotros_foto_a.png\",\"menu\":\"\",\"events\":\"\"}', '1', '', 'custome', '15748738365ddeaaec41f46.png,15748738485ddeaaf8b663f.png,15748738615ddeab05c70cf.png,15748738745ddeab12d98f4.png,15748738865ddeab1eacf2e.png,15748738965ddeab2898dac.png,15748739085ddeab344e789.png,15748739185ddeab3eac72f.png,15748739275ddeab47ea98d.png,157', '{\"image0\":{\"name\":\"15748738365ddeaaec41f46.png\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15748738485ddeaaf8b663f.png\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15748738615ddeab05c70cf.png\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15748738745ddeab12d98f4.png\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15748738865ddeab1eacf2e.png\"