(1810, 'Rafael', 'Pedrosa', 'mayopopeye@hotmail.com', '', 'Popeye', '', '', 'https://www.restaurantepopeye.com/', '1,', '', '+34:956:494424', '', 'yes', 'yes', '1,2,4,6', '1', '19', '11130', '2377', 'Ctra. La Barrosa, Km 4,5 - Calle del Carrajolilla, s/n,,', '', 'La historia de Restaurante Popeye comienza con una cabaña de troncos en 1970, donde los veraneantes y los pescadores hacían un alto antes de ir a la playa. Posteriormente se convertiría en un buen restaurante donde poder cocinar los mejores pescados y mariscos de la Bahía.\r\n \r\nSu carta sigue caracterizada por los mismos platos marineros, que desde siempre han sido su especialidad, como la Urta a la roteña, el Bogavante Bellavista, la Lubina a la sal y muchos otros. Pero su nueva carta de tapas ha dado un aire desenfadado y atrevido al local sin perder la esencia de la cocina tradicional, elaborada con las mejores materias primas que siempre han caracterizado a este restaurante.\r\n\r\n', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15913763795eda79fba4823.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15913758205eda77ccb4dad.jpg\",\"aboutus_image\":\"1591375820Nuestra_historia_restaurantepopeye1.jpg\"}', '1', '', 'custome', '15913719955eda68db55544.jpg,15913720035eda68e3cd6a8.jpg,15913720145eda68eee5caf.jpg,15913720275eda68fb383c0.jpg,15913720375eda6905b7b73.jpg,15913720485eda691101336.jpg,15913720645eda692073103.jpg,15913720795eda692fbd541.jpg,15913720915eda693b12591.jpg,159', '{\"image0\":{\"name\":\"15913719955eda68db55544.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15913720035eda68e3cd6a8.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15913720145eda68eee5caf.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15913720275eda68fb383c0.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15913720375eda6905b7b73.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"15913720485eda69