(1812, 'Martín', 'Chiapparrone', 'info@lagaleriabar.com', '', 'La Galería Gastrobar', '', '', 'https://lagaleriabar.com/', '2,', '', '+34:654:476614', '', 'yes', 'yes', '1,2,4,6', '1', '20', '29680 ', '2424', 'Calle Caridad, 48,,,', '', 'Situado en el corazón de Estepona, La Galeria es uno de los restaurantes y bares de copas más destacados y populares por su diseño interior, la calidad y diversidad en sus platos, tapas y vinos, acompañado por la mejor atención por parte de nuesro staff, los cuales te harán sentir como en casa. Ven a conocernos.\r\nCon casi 100 metros cuadrados de local, aire acondicionado, baño y rampa para minusválidos, La Galería se convierte en un lugar donde podrás festejar cumpleaños, bautizos, pequeñas bodas o simplemente disfrutar de uno de sus deliciosos platos junto a tu familia y amigos.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15917187305edfb34a6b926.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15917194685edfb62c797ef.jpg\",\"aboutus_image\":\"1591718730galeria_about_us.jpg\"}', '2', '', 'custome', '15917185575edfb29dde5f6.jpg,15917185675edfb2a707d0e.jpg,15917185755edfb2afb5066.jpg,15917185845edfb2b8701a2.jpg,15917185935edfb2c1a8c72.jpg,15917186025edfb2ca6a90f.jpg,15917186145edfb2d6460f8.jpg,15917186225edfb2de69829.jpg,15917186335edfb2e9eb420.jpg,159', '{\"image0\":{\"name\":\"15917185575edfb29dde5f6.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15917185675edfb2a707d0e.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15917185755edfb2afb5066.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15917185845edfb2b8701a2.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15917185935edfb2c1a8c72.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"15917186025edfb2ca6a90f.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"15917186145edfb2d6460f8.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"1591718