(1813, 'Carlos', 'Martínez', 'tubio3870@gmail.com', '', 'A Plomo Cádiz', '', '', 'https://aplomocadiz.com/', '1,', '', '+34:856:071057', '', 'yes', 'yes', '1,2,4,6', '1', '19', '11009', '2373', 'Calle Fernández Ballesteros, 3,,,', '', 'Ubicado en un entorno privilegiado como es el casco antiguo de la ciudad de Cádiz y con chefs de prestigio, como Carlos Martínez y Ramón Álvarez detrás de la elaboración de sus exquisitos platos,  Restaurante A Plomo les ofrece a sus comensales una experiencia gastronómica inolvidable.\r\nEspecialidades como el risotto de manitas y boletus, el foie micuit y palo cortado, los gambones kataifi y curry, el paté de ortiguillas, las patatas bravas la facera de atún con coliflor, el tartar de salmón o el cordero lechal con espinacas y payoyo.\r\nAdemás, cuentan con un servicio profesional en tu casa. Llevan el restaurante a tu hogar. Se concierta un menú, ellos hacen la compra, y 2 horas antes, sus cocineros te preparan una comida como la que sirven en su local. \r\n\r\n', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15917755075ee09113cd1cf.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15917740915ee08b8bcaea2.jpg\",\"aboutus_image\":\"1591775507aplomo_about_us1.jpg\"}', '1', '', 'custome', '15917742605ee08c3422d7b.jpg,15917742675ee08c3bcd95c.jpg,15917742775ee08c45be92e.jpg,15917742895ee08c51ae66f.jpg,15917742985ee08c5aa43f7.jpg,15917743085ee08c645b644.jpg,15917743185ee08c6e83b34.jpg,15917743275ee08c7743283.jpg,15917743355ee08c7fc8d99.jpg,159', '{\"image0\":{\"name\":\"15917742605ee08c3422d7b.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15917742675ee08c3bcd95c.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15917742775ee08c45be92e.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15917742895ee08c51ae66f.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15917742985ee08c5aa43f7.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\