(1816, 'José', 'Perea', 'lafresquitadeperea@gmail.com', '', 'La Fresquita de Perea', '', '', '', '1,2', '', '+34:637:366659', '', 'yes', 'yes', '1,2,4,6', '1', '19', '11393', '2413', 'Calle Alcarabán, 8,', '', 'La Fresquita de Perea es un restaurante especializado en platos elaborados a base de atún, un producto tan típico de la costa gaditana, pero al mismo tiempo con una carta muy variada.\r\nRegentado por una jóven pareja, este lugar es muy popular en la zona, y no es por gusto.\r\nCon una decoración y una preciosa terraza que invitan a relajarse, venir a este lugar se convertirá en una experiancia que díficilmente no querrás volver a repetir.\r\n\r\nProductos frescos y de primera calidad.\r\nMuy buen ambiente y trato excepcional.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15918854855ee23ead67d3e.jpg\",\"cover_image\":\"15918854855ee23ead67fc9.jpg\",\"aboutus_image\":\"1591886533sobre_nosotros.jpg\",\"catgory_photo\":\"\",\"menu\":\"\",\"events\":\"\"}', '1', '', 'custome', '15918857355ee23fa7e9332.jpg,15918857455ee23fb1117c3.jpg,15918857595ee23fbf12ec7.jpg,15918857695ee23fc9b27f4.jpg,15918857815ee23fd57f2fc.jpg,15918857895ee23fdd64545.jpg,15918857985ee23fe62c596.jpg,15918858065ee23fee7c3fd.jpg,15918858175ee23ff96f79b.jpg,159', '{\"image0\":{\"name\":\"15918857355ee23fa7e9332.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15918857455ee23fb1117c3.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15918857595ee23fbf12ec7.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15918857695ee23fc9b27f4.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15918857815ee23fd57f2fc.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"15918857895ee23fdd64545.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"15918857985ee23fe62c596.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"15918858065ee23fee7c3fd.jpg\",\"title\":\"\",\"des\":\"\"},\"image8\"