(1818, 'Langolo', 'Langolo', 'langolotrattoria@gmail.com', '', 'L\'Angolo Trattoria Italiana', '', '', '', '1,3', '', '+34:673:319896', '', 'yes', 'yes', '1,2,4,6', '1', '19', '11393', '2413', 'Calle Marina, 1,,,', '', 'L\'Angolo: la esquina, el vértice, la punta...Nuestro restaurante, fruto de la pasión por la cocina y el amor a Zahara de los Atunes. Una familia de personas de todas partes del mundo unidos todos por el auténtico sabor italiano de nuestra cocina. Pizzas y pastas, quesos y embutidos, toda materia prima italiana, atunes y retintos de la zona y de inmejorable calidad. Una variada carta de vinos y cervezas artesanales andaluzas, nos permite lograr y ofrecer nuestro sabor inconfundible. Un local de estilo urbano, actual y amplio, idóneo para familias. El trato y la personalidad de todo nuestro equipo desde la cocina a la sala funden un ambiente especial. Platos vegetarianos y veganos, pizzas y pastas SIN GLUTEN. ', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15922947395ee87d53dc1f8.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15922969615ee88601cd537.jpg\",\"aboutus_image\":\"1592296961about_us.jpg\"}', '1', '', 'custome', '15930958555ef4b6afa1b27.jpg,15930958725ef4b6c001d5f.jpg,15930958795ef4b6c7799fb.jpg,15930958885ef4b6d056733.jpg,15930958975ef4b6d9efe3e.jpg,15930959065ef4b6e2a910d.jpg,15930959185ef4b6ee7ba5f.jpg,15930959275ef4b6f73a9c5.jpg,15930959395ef4b7037897a.jpg,159', '{\"image0\":{\"name\":\"15930958555ef4b6afa1b27.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15930958725ef4b6c001d5f.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15930958795ef4b6c7799fb.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15930958885ef4b6d056733.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15930958975ef4b6d9efe3e.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"15930959065ef4b6e2a910d.jpg\",\"title\":\"\",\"des\":\"\"},\"image6