(1830, 'Jesús', 'Recio', 'sonambulocadiz@gmail.com', '', 'Restaurante & Bar Sonámbulo', '', '', 'http://www.sonambulocadiz.com/', '1,2', '', '+34:661:770790', '', 'yes', 'yes', '1,2,4,6', '1', '19', '11005', '2373', 'Plaza Candelaria, 12, ,,', '', 'En restaurante Sonámbulo queremos que te sientas en casa. Un espacio para que pases sin prisas, para tomar un vermú, para disfrutar con amigos; con almuerzos en familia. Un espacio para grupos grandes, eventos personalizados y abiertos a nuevas propuestas.\r\nNuestra etiqueta, la cercanía. El cuidado de las pequeñas cosas, sin corsés. Lo simple. Estar, sin que te des cuenta. Activos, preparados, dispuestos y sociables.\r\nLuces ténues, olor a madera y suelo antiguo, gris y frío para llenarlo de gente cálida y acompañarlos de buena música y algún concierto. Una barra para charlar por los codos, beber y comer todos a una, de pié o sentado, en compañía o sin ella. Mesas grandes, pequeñas, altas y redondas para conversar alrededor de ellas, y lo que aquí pase, se quede entre la madera.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15926447555eedd4933a7af.jpg\",\"menu\":\"15926448595eedd4fb835ab.pdf\",\"events\":\"\",\"cover_image\":\"15928254265ef096523fae9.jpg\",\"aboutus_image\":\"1592645260about_us.jpg\"}', '1', '', 'custome', '15926448885eedd5183ef28.jpg,15926448995eedd5239e228.jpg,15926449085eedd52cd7ad8.jpg,15926449175eedd535894cd.jpg,15926449265eedd53ee683c.jpg,15926449365eedd548a58a4.jpg,15926449465eedd5528cfbc.jpg,15926449605eedd560a815f.jpg,15926449705eedd56ae7511.jpg,159', '{\"image0\":{\"name\":\"15926448885eedd5183ef28.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15926448995eedd5239e228.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15926449085eedd52cd7ad8.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15926449175eedd535894cd.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15926449265eedd53ee