(1894, 'Rodrigo', 'Rodrigo', 'rinconrodri48@gmail.com', '', 'El Rincón de Rodri', '', '', '', '1,3', '', '+34:958:522817', '', 'yes', 'yes', '1,2,4', '1', '3', '18002', '179', 'Calle Músico Vicente Zarzo, 3, ,,', '', 'Estupendo restaurante y bar de tapas situado en la ciudad de Granada. y con una ubicación privilegiada.\r\nCocina mediterránea y española y especialidades en mariscos.\r\nTodos sus platos están preparados de manera artesana, utilizando únicamente productos frescos y de primera calidad.\r\nExcelente servicio y trato al público.\r\nMuy buena relación calidad-precio.\r\n', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15936021035efc7037e89e9.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15936021035efc7037e8b6d.jpg\",\"aboutus_image\":\"1593602103rodri_about_us.jpg\"}', '1', '', 'custome', '15936009945efc6be23251c.jpg,15936010005efc6be8f068d.jpg,15936010105efc6bf239434.jpg,15936010165efc6bf8e9d64.jpg,15936010275efc6c03634d8.jpg,15936010345efc6c0aa0c63.jpg,15936010435efc6c13a0d39.jpg,15936010505efc6c1a9342f.jpg,15936010595efc6c23f08be.jpg,159', '{\"image0\":{\"name\":\"15936009945efc6be23251c.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15936010005efc6be8f068d.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15936010105efc6bf239434.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15936010165efc6bf8e9d64.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15936010275efc6c03634d8.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"15936010345efc6c0aa0c63.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"15936010435efc6c13a0d39.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"15936010505efc6c1a9342f.jpg\",\"title\":\"\",\"des\":\"\"},\"image8\":{\"name\":\"15936010595efc6c23f08be.jpg\",\"title\":\"\",\"des\":\"\"},\"image9\":{\"name\":\"15936010695efc6c2d953ee.jpg\",\"title\":\"\",\"des\":\"\"}}', 0, 0, '0', '0', '', '