(1895, 'Alberto', 'Alberto', 'info@lavinotecagranada.es', '', 'La Vinoteca', '', '', '', '1,2', '', '+34:615:991761', '', 'yes', 'yes', '1,2,4,6', '1', '3', '18010', '179', 'La Vinoteca,,', '', 'La Vinoteca de Granada.\r\nUn lugar diferente con todo el encanto que una casa de vinos pueda tener.\r\nGran variedad en en su carta, tanto de comidas como de vinos..\r\nTodos sus platos están elaborados de manera casera, con ingredientes de primera calidad y productos de temporada, lo que garantiza la máxima frescura.\r\nUn lugar al que no acudir con prisas, para poder disfrutar de cada bocado, siempre en la mejor compañía.\r\nInmejorable trato al cliente envuelto en un excelente ambiente.\r\nUno de esos lugares al que acudir una y otra vez.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15936141335efc9f351518c.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15936141335efc9f35152e3.jpg\",\"aboutus_image\":\"1593615189vinoteca_about_us.jpg\"}', '1', '', 'custome', '15936149095efca23d76291.jpg,15936149185efca2463e17e.jpg,15936149315efca25324dac.jpg,15936149445efca2608913f.jpg,15936149535efca269cf744.jpg,15936149635efca2736a2d7.jpg,15936149765efca2803c7e3.jpg,15936149865efca28a9b441.jpg,15936149965efca294ad554.jpg,159', '{\"image0\":{\"name\":\"15936149095efca23d76291.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15936149185efca2463e17e.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15936149315efca25324dac.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15936149445efca2608913f.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15936149535efca269cf744.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"15936149635efca2736a2d7.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"15936149765efca2803c7e3.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"15936149865efca28a9b441.jpg\",\"title\":\"\",\"des\":\"\"},\"image8\":{\"name\":\"1593614