(1911, 'Samuel', 'Hernández', 'restaurantecala.granada@gmail.com', '', 'Restaurante Cala', '', '', 'https://restaurantecalagranada.es/', '1,', '', '+34:858:989058', '', 'yes', 'yes', '1,2,4,6', '1', '3', '18006', '179', 'Calle José Luis Pérez Pujadas, 2,,,', '', 'Restaurante Cala se encuentra situado en la \\\"zona Forum\\\" de Granada, cerca del Parque de Las Ciencias.\r\nEn Cala te proponemos una restauración tradicional con toques vanguardistas, utilizando productos internacionales, debido al arraigo de la cocina francesa del chef, Samuel Hernández. Nuestros productos son frescos, principalmente de temporada y en su gran mayoría de la propia provincia, donde prima la materia ecológica.\r\nConstancia, fundamento, producto, sabores y matices sorprendentes rodeados de un gran equilibrio son nuestra base del trabajo del día a día.\r\nCon 3 zonas con una capacidad de entre 30 y 40 comensales, en Cala podrás organizar tu evento privado con la mayor garantía. Tú propones y nosotros te ayudamos encantados.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15956039175f1afbcd87a08.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15951703575f145e354e040.jpg\",\"aboutus_image\":\"1595168148cala_sobre_nosotros.jpg\"}', '1', '', 'custome', '15951709205f146068bfeac.jpg,15951709295f14607159161.jpg,15951709395f14607bf269d.jpg,15951709755f14609f9b299.jpg,15951709865f1460aa85bd4.jpg,15951709985f1460b6157eb.jpg,15951710065f1460be0cea5.jpg,15951710165f1460c822773.jpg,15951710265f1460d2a25d4.jpg,159', '{\"image0\":{\"name\":\"15951709205f146068bfeac.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15951709295f14607159161.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15951709395f14607bf269d.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15951709755f14609f9b299.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15951709865f1460aa85bd4.jpg\",\"title\":\"\",\"des\":\"\"},\