(1913, 'Saira', 'Derfield', 'sairaderfield@hotmail.com', '', 'Chilimosa', '', '', 'https://www.chilimosa.com/', '1,', '', '+34:956:685092', '', 'yes', 'yes', '1,2,4,6', '1', '19', '11380', '2389', ' Calle del Peso, 6, ,,', '', 'Chilimosa es un restaurante de cocina vegetariana y vegana situado en la emblemática ciudad de Tarifa.\r\nUtilizando únicamente productos frescos, procedentes de una agricultura sostenible y 100% ecológica, este pequeño establecimento no te dejará indiferente, ya que su decoración es muy original y acorde a sus principios. Además, su cocina es casera y artesana.\r\nExcelente trato al público y ambiente muy familiar.\r\nMuy buena relación calidad-precio.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15952479345f158d3f00948.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15952464895f158799dc7a7.jpg\",\"aboutus_image\":\"1595246972chilimosa_about_us.jpg\"}', '1', '', 'custome', '15952463065f1586e28c987.jpg,15952463135f1586e9ded92.jpg,15952463235f1586f3f1f19.jpg,15952463325f1586fc129d3.jpg,15952463425f1587064cc9a.jpg,15952463495f15870d93a08.jpg,15952463665f15871e26908.jpg,15952463745f1587260d195.jpg,15952463855f158731d76a9.jpg,159', '{\"image0\":{\"name\":\"15952463065f1586e28c987.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15952463135f1586e9ded92.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15952463235f1586f3f1f19.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15952463325f1586fc129d3.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15952463425f1587064cc9a.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"15952463495f15870d93a08.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"15952463665f15871e26908.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"15952463745f1587260d195.jpg\",\"title\":\"\",\"des\":\"\"},\"image8\":{\"name\":\"15952463855f158731d76a9.jpg\",\"title\":\"\",\"des\":\"\"},\"ima