(1924, 'José Eduardo', 'Muñoz', 'info@ligula.restaurant', '', 'Lígula Restaurante Tradicional', '', '', 'http://www.ligula.restaurant/', '1,', '', '+34:951:485128', '', 'yes', 'yes', '1,2,4,6', '1', '20', '29006', '2417', 'Calle Shanti Andía, 9,', '', 'En Lígula elaboramos nuestros platos con productos de temporada seleccionados cuidadosamente para presentarlos en su mesa de forma original.\r\nUn lugar donde la tradición de nuestra cocina regional y la innovación con nuevas propuestas se dan la mano.\r\nAl frente de nuestro restaurante un equipo de profesionales de la restauración, de trato cercano que le hará sentir como en casa y hará de su visita la primera de muchas otras.\r\nSomos personas que trabajan para las personas. \r\nEn Ligula Restaurante en Málaga encontrará una exquisita combinación de la cocina tradicional malagueña con influencia internacional, los mejores profesionales y nuestra amplia experiencia. Todos esos ingredientes forman la receta perfecta para hacerle vivir una experiencia única.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15954261385f18455a443e3.jpg\",\"cover_image\":\"15954294555f18524fd33ae.jpg\",\"aboutus_image\":\"1595434133ligula_about_us.jpg\",\"catgory_photo\":\"15962065675f242de70f0cd.jpg\",\"menu\":\"\",\"events\":\"\"}', '1', '', 'custome', '15955183545f19ad926aa40.jpeg,15955224505f19bd9265bd7.jpeg,15955224905f19bdba59d0b.jpeg,15955226885f19be80b3607.jpeg,15955228245f19bf08b8c06.jpeg,15955254785f19c966b1969.jpeg,15955255405f19c9a4f26ec.jpeg,15955256815f19ca31ae864.jpeg,15955257615f19ca811dab0', '{\"image0\":{\"name\":\"15955183545f19ad926aa40.jpeg\",\"title\":\"Cresta Burguer Malague\\u00f1a\",\"des\":\"\"},\"image1\":{\"name\":\"15955224505f19bd9265bd7.jpeg\",\"title\":\"Ensalada Quinoa\",\"des\":\"\"},\"image2\":{\"name\":\"15955224905f19bdba59d0b.jpeg\",\"title\":\"Croquetas de Jam\\u00f3n\",\"des\":\"\"},\"image3\":{\"name\":\"15955226885f19be80b