(1932, 'Vikas', 'Maheshwari', 'vikas@backendbrains.com', '6e6bfbca784499405675dbe28a115ba1', 'Vikas New restaurant', '', '', 'vikas@gmail.com', '2,', '', '+91:990:464107', '', 'yes', 'yes', '1,2,3,4,5,6', '1', '19', '11370', '2386', 'Av. Inmaculada, 2,,,', '', 'Restaurante Cala se encuentra situado en la \\\"zona Forum\\\" de Granada, cerca del Parque de Las Ciencias.\r\nEn Cala te proponemos una restauración tradicional con toques vanguardistas, utilizando productos internacionales, debido al arraigo de la cocina francesa del chef, Samuel Hernández. Nuestros productos son frescos, principalmente de temporada y en su gran mayoría de la propia provincia, donde prima la materia ecológica.\r\nConstancia, fundamento, producto, sabores y matices sorprendentes rodeados de un gran equilibrio son nuestra base del trabajo del día a día.\r\nCon 3 zonas con una capacidad de entre 30 y 40 comensales, en Cala podrás organizar tu evento privado con la mayor garantía. Tú propones y nosotros te ayudamos encantados.', '', 'merchant', 2, 'active', '5f6892c03d183', '', 'inactive', 'active', '2020-07-23 07:44:38', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15956548895f1bc2e97f147.jpg\",\"menu\":\"15955810305f1aa266092f9.pdf\",\"events\":\"\",\"cover_image\":\"15955042685f19768c72a99.jpg\",\"aboutus_image\":\"1595492327food-8.jpg\"}', '1', '', 'custome', '', '', 0, 0, '100', '50', '', '{\"google\":\"vikasm\",\"facebook\":\"vikasm\",\"twitter\":\"vikasm\",\"instagram\":\"vikasm\"}', 1, '12345678v', 1, 1, 'NIF', NULL, 0, '34/New rajhans society, Near navnirman school', NULL, NULL, '15', '{\"Monday\":[\"09:00-10:00\",\"08:00-16:30\"],\"Tuesday\":[\"11:30-14:00\"],\"Wednesday\":[\"14:00-17:30\"],\"Thursday\":[\"08:00-16:30\"],\"Friday\":[\"16:00-21:00\"],\"Saturday\":[\"Closed\"],\"Sunday\":[\"Closed\"]}', 'yes', 'yes', 1, 0, 'vikasnewrestaurant', '', '', 0, 1, NULL, NULL, NULL, NULL, 0, NULL, '1', 1, NULL, NULL, NULL, NULL, NULL),
