(1936, 'Ramón', 'García', 'gm.palaciopatos@hospes.com', '', ' Restaurante Los Patos | Hospes Palacio de los Patos', '', '', 'https://www.hospes.com/en/palacio-patos/los-patos-restaurant/', '1,', '', '+34:958:535790', '', 'yes', 'yes', '1,2,4,6', '1', '3', '18002', '179', 'Solarillo de Gracia, 1, ', '', 'El Restaurante Los Patos se encuentra en la planta baja del nuevo edificio del Hotel Hospes Palacio de los Patos. Su situación es única por ubicarse en el centro de la ciudad, a lo que se une una oferta gastronómica comprometida con los productos naturales, genuinos y saludables. Utilizamos novedosas técnicas culinarias con ingredientes seleccionados por su estacionalidad y frescura.\r\nUn punto fuerte a destacar de la alta gastronomía del Restaurante Patos son sus carnes: como por ejemplo el costillar de cordero segureño lechal con ensalada de couscous, pepino y yogur aromatizado con menta.\r\nEn nuestra exclusiva terraza situada en el jardín podrá disfrutar de nuestra selección de cócteles, vinos y tapas, así como de los platos de la carta del Restaurante Los Patos.\r\n\r\n', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15956074255f1b0981edf92.jpg\",\"cover_image\":\"15956074255f1b0981ee086.jpg\",\"aboutus_image\":\"1595606789patos_about_us.jpg\",\"catgory_photo\":\"\",\"menu\":\"\",\"events\":\"\"}', '1', '', 'custome', '15956061705f1b049a6373d.jpg,15956061805f1b04a451b0f.jpg,15956061945f1b04b250576.jpg,15956062055f1b04bde6e43.jpg,15956062265f1b04d22a8de.jpg,15956062345f1b04da2dbe4.jpg,15956062445f1b04e454ec0.jpg,15956062585f1b04f2254fc.jpg,15956063085f1b052483215.jpg,159', '{\"image0\":{\"name\":\"15956061705f1b049a6373d.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15956061805f1b04a451b0f.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15956061945f1b04b250576.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15956062055f1b04bde6e43.jpg\",\"title\":\"\",\"de