(1937, 'Sanjay', 'Sadhwani', 'kvmarashwni72@gmail.com', '', 'Tandoori Mexican', '', '', '', '1,3', '', '+34:951:956006', '', 'yes', 'yes', '1,2,4,6', '1', '20', '29005', '2417', 'Calle Esparteros, 8,,,', '', 'Tandoori Mexican es un restaurante que combina los sabores de la cocina india y la mejicana.\r\nUna sorprendente fusión de sabores, matices y aromas que no te dejarán indiferente.\r\nTodos nuestros platos están preparados de manera casera y con ingredientes frescos.\r\nMuy buena atención al público y ambiente familiar y relajado, rodeado de una decoración totalmente en línea con la cocina a la que representa.\r\n', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15957813875f1db10bd5086.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15957813875f1db10bd5213.jpg\",\"aboutus_image\":\"1595781387tandoori_about_us.jpg\"}', '2', '', 'custome', '15957808125f1daeccb973d.jpg,15957808225f1daed67c65c.jpg,15957808335f1daee15dfe8.jpg,15957808435f1daeeb04f3d.jpg,15957808545f1daef63084d.jpg,15957808635f1daeffe09e3.jpg,15957808795f1daf0f9e1cf.jpg,15957808885f1daf18e529a.jpg,15957809225f1daf3a7ff6c.jpg,159', '{\"image0\":{\"name\":\"15957808125f1daeccb973d.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15957808225f1daed67c65c.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15957808335f1daee15dfe8.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15957808435f1daeeb04f3d.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15957808545f1daef63084d.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"15957808635f1daeffe09e3.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"15957808795f1daf0f9e1cf.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"15957808885f1daf18e529a.jpg\",\"title\":\"\",\"des\":\"\"},\"image8\":{\"name\":\"15957809225f1daf3a7ff6c.jpg\",\"title\":\"\",\"des\":\"\"},\"image9\":{\"name\":\"15957809315f1daf4372f77.jpg\",\"title\":\"\