(1938, 'El Mahi', 'Chebhie', 'info@elvizir.com', '', 'Restaurante El Vizir', '', '', '', '1,', '', '+34:667:003654', '', 'yes', 'yes', '1,2,4,6', '1', '3', '18010', '179', 'Calle Calderería Nueva, 10,,,', '', 'Restaurante El Vizir nació para representar el valor, el cuidado y el querer, con todo esto se pretende ilusionar con nuestro trabajo y dedicación.\r\nAquí compartimos con nuestros clientes el verdadero Arte Culinario marroquí que nos negamos a encasillarlo y limitarlo a unas cuantas recetas y platos típicos. \r\nAbrimos un abanico de toda una cultura llena de perfumes, colores, sabores y por supuesto historia, delante de un atrevido y curioso cliente que desea y busca descubrir y enamorarse de sabores nuevos, y sobretodo invadir mundos y cocinas desconocidas. \r\nEl Vizir busca enamorar y embrujar con su historia que acoge las nuevas tendencias vegetariana y vegana, con el fin de llegar con sus delicias al mayor número de personas, se instala entre vosotros y cerca de todos, en el corazón de la capital NAZARÍ, os esperamos con el corazón abierto, la sonrisa dibujada y la mano tendida.\r\nAQUÍ COMERÁS COMO EN CASA', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15959489605f203fa074d69.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15959489605f203fa074e58.jpg\",\"aboutus_image\":\"1595948960sobre_nosotros.jpg\"}', '1', '', 'custome', '15959486215f203e4d17c58.jpg,15959486275f203e53dcd59.jpg,15959486365f203e5c9ede2.jpg,15959486465f203e66402a3.jpg,15959486535f203e6d3d8b7.jpg,15959486695f203e7dc8897.jpg,15959486855f203e8daf151.jpg,15959486925f203e94904fc.jpg,15959487015f203e9d35d62.jpg,159', '{\"image0\":{\"name\":\"15959486215f203e4d17c58.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15959486275f203e53dcd59.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15959486365f203e5c9ede2.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15959486465f203e66402a3.jp