(1939, 'Mariam', 'Monasterio', 'info@atxuri.com', '', 'Restaurante Atxuri', '', '', '', '1,', '', '+34:956:253613', '', 'yes', 'yes', '1,2,4,6', '1', '19', '11005', '2373', 'Calle Plocia, 7, detrás del Palacio de Congresos', '', 'En 1947, la familia Anasagasti fundó en Cádiz el Restaurante Atxuri. Jon Monasterio Anasagasti se encargó de acercar desde Bermeo a la ciudad andaluza los sabores más típicos de la gastronomía vasca. Y fué precisamente, uno de los barrios más antiguos de Bilbao el que sirvió para dar nombre al nuevo local.\r\nActualmente el Atxuri, está dirigido por Marian Monasterio, hija de Jon Monasterio, la cual dirige el mismo desde el año 2004. Además, su hijo Julen sigue fielmente los pasos de sus antecesores en la que es la tercera generación del Restaurante Atxuri, manteniendo el mismo sabor y estilo que ha caracterizado al local desde sus inicios.\r\nLos platos tienen como pilar básico la misma calidad de antaño. Una novedosa decoración de piedra blanca natural y maderos cruzados en el techo muestran una cara más actual tras el cambio de local en el año 2008… aunque manteniendo el antiguo cuadro de Bermeo al final del pasillo y algunas de las originales baldosas verdes gresite en homenaje al anterior local. Y así, setenta años después de su apertura podemos seguir disfrutando del Atxuri.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15959510055f20479d4caf7.jpg\",\"cover_image\":\"15959510055f20479d4ccca.jpg\",\"aboutus_image\":\"1595950619sobre_nosotros.jpg\",\"catgory_photo\":\"\",\"menu\":\"\",\"events\":\"\"}', '3', '', 'custome', '15959509045f2047382147d.jpg,15959509115f20473f8ef56.jpg,15959509215f20474979cd7.jpg,15959509295f204751520f4.jpg,15959509385f20475a6ad75.jpg,15959509475f2047639d38b.jpg,15959509585f20476e7ffda.jpg,15959509805f20478470819.jpg,15959509935f204791e601c.jpg,159', '{\"image0\":{\"name\":\"15959509045f2047382147d.jpg\",\"title\":\"\",\"des\":\"\"},