(1940, 'Ignacio', 'Durán', 'ignacioduran@h-alhambrapalace.com', '', 'Alhambra Palace Restaurante', '', '', 'https://www.h-alhambrapalace.es/en/restaurant/', '1,', '', '+34:958:221468', '', 'yes', 'yes', '1,2,4,6', '1', '3', '18009', '179', 'Plaza Arquitecto García de Paredes, 1, ,,', '', 'Espectacular restaurante ubicado en el Hotel de cinco estrellas Alhambra Palace, un exquisito hotel con maravillosas vistas en un enclave privilegiado y con más de 100 años de historia.\r\nApostando firmemente por la cultura gastronómica heredera del Al-Andalus, con sus recetas readaptadas a la ‘Cocina Granadina Siglo XXI’. Una mágica fusión culinaria de pasado y presente en un entorno palaciego único.\r\nUn referente de la gastronomía llevada a la excelencia, teniendo su perfecto complemento en la cultura enológica granadina.\r\nSentarse a la mesa de su selecto restaurante será como experimentar un viaje en el tiempo, a través de las recetas, sabores y aromas que entre los siglos VIII y XV llevaron a Al-Andalus novedosos ingredientes y cultivos procedentes de Oriente, que son la base de la cocina actual y de la dieta mediterránea.\r\n', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15959533515f2050c78dd39.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15959533515f2050c78de8b.jpg\",\"aboutus_image\":\"1595953459alhambra_about_us.jpg\"}', '1', '', 'custome', '15959531615f20500948ff4.jpg,15959531695f2050117a119.jpg,15959532485f20506034536.jpg,15959532555f205067ee1b2.jpg,15959532685f20507470d46.jpg,15959532785f20507e4b7e5.jpg,15959532855f20508515e3c.jpg,15959532955f20508f0a972.jpg,15959533025f205096115a9.jpg,159', '{\"image0\":{\"name\":\"15959531615f20500948ff4.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15959531695f2050117a119.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15959532485f20506034536.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15959532555f205067ee1b2