(1941, 'Alexis', 'Aiga', 'alexisaiga@gmail.com', '', 'Mediterráneo Café Bar', '', '', '', '2,', '', '+34:856:073717', '', 'yes', 'yes', '1,2,4,6', '1', '19', '11003', '2373', 'Plaza de Mina, 1, ,,', '', 'Situados en el centro histórico de la ciudad de Cádiz, rodeados de calles comerciales, lugares de interés turístico en una de las plazas más emblemáticas de la ciudad.\r\nDisponemos de terraza exterior y de un amplio salón interior, donde podrás degustar nuestros excelentes platos y tapas.\r\nVen a visitarnos y te sorprenderán tanto el trato personal como la calidad de nuestro servicio. Disponemos de un servicio de cocina con las mejores tapas  y un amplio horario de apertura.\r\nDesayunos, almuerzos, comidas, meriendas y cenas.\r\nDisfruta en uno de los lugares más típicos de la ciudad.\r\nPrueba nuestra selecta gastronomía y disfrútala en uno de los sitios más concurridos de la ciudad. Pide consejo a nuestro servicio y encántate por todo lo que te podemos ofrecer.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"menu\":\"16007676305f69c68ed302a.pdf\",\"logo\":\"15960293775f2179c146b5c.jpg\",\"cover_image\":\"15960286975f217719156e1.jpg\",\"aboutus_image\":\"1596028625mediterraneo_about_us.jpg\",\"events\":\"\"}', '1', '', 'custome', '15960282005f21752874b60.jpg,15960282135f21753517156.jpg,15960282245f2175409cdbb.jpg,15960282385f21754ebb220.jpg,15960282525f21755c58d10.jpg,15960282605f2175643dd27.jpg,15960282675f21756bb7751.jpg,15960282815f2175790378d.jpg,15960283005f21758ca0b85.jpg,159', '{\"image0\":{\"name\":\"15960282005f21752874b60.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15960282135f21753517156.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15960282245f2175409cdbb.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15960282385f21754ebb220.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15960282525f21755c58d10.jpg\",\"title\":\"\",\"des\":\"\"},\"image5