(1943, 'Serie Oro', 'Serie Oro', 'pescaderia.serieoro@gmail.com', '', 'Materia Prima', '', '', 'https://pescaderiaserieoro.es/restaurante-materia-prima/', '1,', '', '+34:666:201989', '', 'no', 'no', '1,2,4,6', '1', '3', '18001', '179', 'Plaza de San Agustín s/n,,', '', 'Perteneciente a Grupo Oro, una empresa dedicada durante más de 25 años a la venta de pescados y mariscos, Materia Prima es un restaurante donde podrás degustar sus deliciosos platos marineros, los cuales están preparados con ingredientes frescos y de una calidad indiscutiblemente superior.\r\nSituado en el Mercado de San Agustín, donde también se encuentra la Pescadería Grupo Oro, de la cual podrás además de adquirir productos de la mar pedir que te los preparen en su exquisito restaurante. \r\nNos avala el buen hacer, el trabajo y que ya somos la tercera generación dedicándonos a los que más nos gusta, los pescados y mariscos y el trato con nuestros clientes.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15961159425f22cbe6e61f3.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15961159425f22cbe6e6378.jpg\",\"aboutus_image\":\"1596115942materia_about_us.jpg\"}', '1', '', 'custome', '15961155635f22ca6b06490.jpg,15961155795f22ca7b4d677.jpg,15961156015f22ca91be811.jpg,15961156295f22caadd0e42.jpg,15961156435f22cabbc3a64.jpg,15961158455f22cb85beacb.jpg,15961158715f22cb9f23ce0.jpg,15961158885f22cbb09c30e.jpg,15961159015f22cbbd8f89e.jpg,159', '{\"image0\":{\"name\":\"15961155635f22ca6b06490.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15961155795f22ca7b4d677.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15961156015f22ca91be811.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15961156295f22caadd0e42.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15961156435f22cabbc3a64.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"15961158455f22cb85beacb.jpg\",\"title\":\"\",\"des\":\"\"}