(1946, 'Michele', 'Michele', 'azzoale@virgilio.it', '', 'Restaurante Bar Carmen', '', '', '', '1,', '', '+34:952:806739', '', 'yes', 'yes', '1,2,4,6', '1', '20', '29680', '2424', 'Km. 159, Laguna Village, A-7,,,', '', 'Restaurante Bar Carmen está ubicado en el complejo hotelero de Laguna Village en Estepona, rodeado de palmeras y con maravillosas vistas al mar.\r\nDe cocina italiana y mediterránea, en Restaurante Carmen podrás disfrutar de una velada inolvidable degustando cualquiera de sus deliciosos platos preparados con productos frescos y principalmente de temporada.\r\nCon una decoración exquisita y un trato al público inmejorable, acudir a este lugar no te dejará indiferente, ya que, sin ningún lugar a dudas, querrás volver a repetir.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15970781325f317a74cfc13.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15970781325f317a74cfd28.jpg\",\"aboutus_image\":\"1597080166carmen_about_us.jpg\"}', '1', 'assets/frontend/images/cover-image/restaurant_banner.png', 'custome', '15970773275f31774fa2d56.jpg,15970779455f3179b97e678.jpg,15970779985f3179eee76f0.jpg,15970780165f317a0044cff.jpg,15970780285f317a0c63899.jpg,15970780405f317a18c167b.jpg,15970780765f317a3c2f4cb.jpg,15970780975f317a5124362.jpg,15970781145f317a62adb68.jpg,159', '{\"image0\":{\"name\":\"15970773275f31774fa2d56.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15970779455f3179b97e678.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15970779985f3179eee76f0.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15970780165f317a0044cff.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15970780285f317a0c63899.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"15970780405f317a18c167b.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"15970780765f317a3c2f4cb.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"15970780975f317a5124362.jpg\