(1947, 'Andrea ', 'Alcivar', 'sumge2008@gmail.com', '', 'Vida Sana Sport Bar', '', '', '', '1,2', '', '+34:626:674790', '', 'yes', 'yes', '1,2,4,6', '1', '20', '29680', '2424', 'Calle Eslovenia, 5,', '', 'VIDA SANA SPORT BAR.\r\nBuen ambiente, deporte y una carta muy variada todo en el mismo lugar. Tanto si eres deportista como si no en nuestro local podrás disfrutar de desayunos, batidos naturales, comida casera y un buen café.  Estamos a solo dos minutos del Puerto Deportivo de Estepona.\r\nCelebración de eventos deportivos, como campeonatos de padel, con paella para cien personas.\r\n\r\nSe permiten mascotas.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15970840825f3191b242fe4.jpg\",\"cover_image\":\"16010306005f6dc9c86583d.jpg\",\"aboutus_image\":\"1601030766about_us.jpg\",\"catgory_photo\":\"\",\"menu\":\"\",\"events\":\"\"}', '3', '', 'custome', '15970840115f31916ba4fc7.jpg,15970840225f31917693e11.jpg,15970840325f3191801eff7.jpg,16010303625f6dc8da17438.jpg,16010303715f6dc8e32732c.jpg,16010303795f6dc8eb20749.jpg,16010303875f6dc8f3950c0.jpg,16010304525f6dc934ebfaa.jpg,16010305185f6dc97675cab.jpg,160', '{\"image0\":{\"name\":\"15970840115f31916ba4fc7.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15970840225f31917693e11.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15970840325f3191801eff7.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"16010303625f6dc8da17438.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"16010303715f6dc8e32732c.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"16010303795f6dc8eb20749.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"16010303875f6dc8f3950c0.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"16010304525f6dc934ebfaa.jpg\",\"title\":\"\",\"des\":\"\"},\"image8\":{\"name\":\"16010305185f6dc97675cab.jpg\",\"title\":\"\",\"des\":\"\"},\"image9\":{\"name\":\"16014628535f74624522457.jpg\",\"tit