(1949, 'Proa de Teatinos', 'Proa de Teatinos', 'info@laproadeteatinos.com', '', 'La Proa de Teatinos', '', '', 'https://laproadeteatinos.com/', '1,', '', '+34:952:274660', '', 'yes', 'yes', '1,2,4,6', '1', '20', '29010', '2417', 'Calle Andrómeda, 11,,', '', 'En el número 11 de la calle Andrómeda de este popular barrio de Málaga estamos esperándote para hacerte sentir como si estuvieras en tu casa por calidad de nuestros platos, personal atento y servicial y por el ambiente agradable y distendido tanto en nuestra terraza como dentro del restaurante, al mediodía y de noche. Algo para picar, ensaladas, tartares, fritos, carnes y nuestras especialidades en arroces son algunos de los platos que forman nuestra renovada carta que hemos creado con todo nuestro cariño para seducirte. Y ¿qué mejor que nuestros postres caseros para terminar con un gusto dulce?\r\nNo te resistas más y ven, porque sabemos que repetirás…', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15972413565f33f80c7d2e2.jpg\",\"cover_image\":\"1613382758602a4466df538.jpg\",\"aboutus_image\":\"1598984055proa_about_us.jpg\",\"catgory_photo\":\"\",\"menu\":\"\",\"events\":\"\"}', '1', '', 'custome', '15989835845f4e8da0726d3.jpg,15989835955f4e8dab574c7.jpg,15989836345f4e8dd279a2b.jpg,15989836465f4e8ddec69a0.jpg,15989836565f4e8de83c2b0.jpg,15989836675f4e8df3d9e5a.jpg,15989836785f4e8dfe98878.jpg,15989836885f4e8e0857e22.jpg,15989836975f4e8e113f4fc.jpg,159', '{\"image0\":{\"name\":\"15989835845f4e8da0726d3.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15989835955f4e8dab574c7.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15989836345f4e8dd279a2b.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15989836465f4e8ddec69a0.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15989836565f4e8de83c2b0.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"15989836675f4e8df3d9e5a.jpg\",\"title\":\"\",\"des\":\"\"