(1951, 'Antonio', 'Antonio', 'elpaladarcay@hotmail.com', '', 'El Paladar', '', '', 'https://restauranteelpaladar.es/', '1,', '', '+34:652:746908', '', 'yes', 'yes', '1,2,4,6', '1', '19', '11012', '2373', 'Calle Medina Sidonia, 9,,', '', 'Restaurante El Paladar combina los elementos de la cocina mediterránea con sabores caseros y tradicionales de la gastronomía gaditana.\r\nLa preparación de todo tipo de guisos y, como no, del pescado, recién traído de las costas de Cádiz son toda una referencia gastronómica.\r\nSituado en una de las zonas más populares de Cádiz, cerca de la Avenida La Bahía, podrás disfrutar de las espectaculares vistas sobre la Bahía de Cádiz y el Puerto Deportivo.\r\nInmejorable servicio y excelente comida, poniendo empeño en cada pequño detalle.\r\nEn El Paladar se utilizan materias primas locales, productos de primera calidad y técnicas de alta cocina para la elaboración de todos sus platos.\r\nDecoración y diseño en tonos neutros y madera y mucha iluminación, además de las comodidades de un entorno climatizado.\r\n', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"1613381475602a3f63e0da5.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"1613382397602a42fd3a67c.jpg\",\"aboutus_image\":\"1613380950aladar_about_us.jpg\"}', '1', '', 'custome', '15979153515f3e40d7c27c6.jpg,15979153665f3e40e6b6ff1.jpg,15979153805f3e40f47d371.jpg,15979167055f3e462196aa3.jpg,15979167205f3e4630eee89.jpg,15979167355f3e463f74be1.jpg,15979167485f3e464c2e9ef.jpg,15979167605f3e46585bbbc.jpg,15979167765f3e466880329.jpg,159', '{\"image0\":{\"name\":\"15979153515f3e40d7c27c6.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15979153665f3e40e6b6ff1.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15979153805f3e40f47d371.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15979167055f3e462196aa3.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15979167205f3e4630eee89.jpg\