(1952, 'Charrúa', 'Charrúa', 'charruamarbella@gmail.com', '', 'The Charrúa Steakhouse', '', '', 'https://charruamarbella.com/', '1,', '', '+34:952:863520', '', 'yes', 'yes', '1,2,4,6', '1', '20', '29601', '2418', 'Calle Caballeros, 15,,', '', 'The Charrúa Steakhouse es un excelente asador de carne que combina lo mejor de la cocina rioplatense con la cocina tradicional uruguaya.\r\nCortes de carne super seleccionados, achuras, ensaladas, milanesas, empanadas y postres clásicos del Río de la Plata.\r\n\r\nSituado en el caso antiguo de Marbella, The Charrúa Steakhouse ofrece a sus comensales una gran variedad de platos entre los que cabe destacar, como no, sus deliciosas empanadas aunque también disponen de varias opciones vegetarianas.\r\n\r\nTres plantas con terraza abierta.\r\nReserva para grupos.\r\n\r\nServicio a domicilio y Take Away.\r\n\r\nUn lugar con encanto donde el servicio y el trato al cliente son inmejorables.\r\n', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15980296575f3fff5990412.jpg\",\"cover_image\":\"15980296575f3fff5990580.jpg\",\"aboutus_image\":\"1598029657charrua_about_us.jpg\",\"catgory_photo\":\"\",\"menu\":\"\",\"events\":\"\"}', '1', '', 'custome', '15980284235f3ffa87f1057.jpg,15980284335f3ffa916b003.jpg,15980284435f3ffa9b65cc8.jpg,15980284525f3ffaa4828ba.jpg,15980284645f3ffab013670.jpg,15980284735f3ffab9c27ec.jpg,15980285355f3ffaf77d1af.jpg,15980285465f3ffb02320b6.jpg,15980285545f3ffb0ad43c7.jpg,159', '{\"image0\":{\"name\":\"15980284235f3ffa87f1057.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15980284335f3ffa916b003.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15980284435f3ffa9b65cc8.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15980284525f3ffaa4828ba.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15980284645f3ffab013670.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"15980284735f3ffab9c27ec.jpg\",\"tit