(1956, 'Ángel', 'Rodríguez', 'aragranada36@gmail.com', '', 'Restaurante Aljibe 1644', '', '', 'https://www.restaurantealjibe1644.com/en', '1,', '', '+34:958:216325', '', 'yes', 'yes', '1,2,4,6', '1', '3', '18010', '179', 'Carrera del Darro, 9,,', '', 'Adéntrate en la historia... Sabor y cultura comparten mantel para ofrecer a los comensales coloridas ensaladas, jugosos pescados y sabrosas carnes, todo ello regado con vino de nuestra tierra granadina.\r\nReserva tu mesa en nuestro patio del siglo XVII...con todas las medidas de sanidad y distanciamiento para disfrutar de un almuerzo en un lugar con historia.\r\nCelebra tu almuerzo o cena de Navidad, cumpleaños, bautizos, cocktails de empresa... Pide presupuesto sin compromiso.\r\nConsulta nuestros menús.\r\nNuestro chef Ángel Rodriguez recupera los sabores antiguos ofreciendo una cocina auténtica con productos granadinos.\r\nUn lugar con muchísimo encanto en un enclave privilegiado, donde la mezcla de sabores y el buen servicio se dan la mano para regalarte un momento mágico y único.\r\n\r\n', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15984585135f468a91eb55e.png\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15984585135f468a91ebbeb.jpg\",\"aboutus_image\":\"1598456313aparicios_about_us.jpg\"}', '1', '', 'custome', '15984455245f4657d44f703.jpg,15984455395f4657e3ab429.jpg,15984455535f4657f1499b7.jpg,15984455745f4658069ee2b.jpg,15984455845f465810049d9.jpg,15984455935f46581911f2b.jpg,15984456025f465822eca66.jpg,15984456125f46582c1e3a9.jpg,15984456435f46584ba3197.png,159', '{\"image0\":{\"name\":\"15984455245f4657d44f703.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15984455395f4657e3ab429.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15984455535f4657f1499b7.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15984455745f4658069ee2b.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15984455845f465810049