(1957, 'Cuatromanos', 'Cuatromanos', 'galeriadesabores13@gmail.com', '', 'Restaurante CuatroManos', '', '', 'https://www.cuatromanos.es/', '1,', '', '+34:957:110591', '', 'yes', 'yes', '1,2,4,6', '1', '2', '14003', '104', 'Calle San Felipe, 13,,,', '', 'Cuatromanos, dos hermanos, un mismo sueño. Desde el 1 de Mayo del año 2015 comienza esta idea de crear una cocina vanguardista, mezclando la tradición con la novedad culinaria.  \r\nCuidamos el detalle para ofrecer máxima calidad en cada servicio prestado, en cada relación con el cliente. Disfrute al máximo de su experiencia con nosotros, En Restaurante Cuatro Manos cuidamos el perfil de cada una de las personas que trabajan aquí. Será atendido y servido por profesionales de los pies a la cabeza que harán que se sienta como en casa al visitar nuestro Restaurante.\r\nOfrecemos variedad en nuestra carta, poniendo la máxima ilusión y cariño en la elaboración de cada plato. La presencia es fundamental para que la degustación sea exquisita, y por ello cuidamos el acabado de nuestras elaboraciones.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15985307765f47a4d84153e.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15985307765f47a4d841649.jpg\",\"aboutus_image\":\"15985307764manos_about_us.jpg\"}', '1', '', 'custome', '15985302085f47a2a042471.jpg,15985302185f47a2aa4996b.jpg,15985302285f47a2b4594d5.jpg,15985302365f47a2bca018c.jpg,15985302555f47a2cfd9479.jpg,15985302665f47a2da8e92b.jpg,15985302825f47a2ead4a07.jpg,15985302935f47a2f58a1d0.jpg,15985303215f47a31113172.jpg,159', '{\"image0\":{\"name\":\"15985302085f47a2a042471.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15985302185f47a2aa4996b.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15985302285f47a2b4594d5.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15985302365f47a2bca018c.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15985302555f47a2cfd9479