(1968, 'José Andrés', 'Jiménez', 'baralmijara@gmail.com', '', 'Almijara Casual Bar', '', '', 'https://almijaracasualbar.com/', '2,', '', '+34:951:353900', '', 'yes', 'yes', '1,2,4,6', '1', '20', '29002', '2417', 'Pasaje San Fernando, 3,,,', '', 'Más de tres décadas de dedicación a la hostelería. Ese es nuestro mejor aval cuando queremos presentarnos a nuestros clientes. Almijara Casual Bar es un establecimiento donde la tradición y la innovación van de la mano. Desde que abrimos las puertas de nuestro negocio hemos trabajado para dar a nuestros clientes la mejor materia prima y los mejores vinos. El concepto ‘casual bar’ es la antesala de una propuesta gastronómica de raíces, con marcada esencia y sabores de siempre, a la que sumamos platos novedosos y con sello propio. Nuestro chef, José Andrés Jiménez, es un fiel defensor de la cocina de producto, siempre atendiendo a la evolución de las tendencias gastronómicas, pero sin perder de vista los sabores de la cocina de antaño.\r\n', '', 'merchant', 2, 'active', '', '', 'inactive', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15989832875f4e8c7774e29.jpg\",\"cover_image\":\"15989832875f4e8c7774f2d.jpg\",\"aboutus_image\":\"1598983287almijara_about_us.jpg\",\"catgory_photo\":\"16001167065f5fd7e29938c.jpg\",\"menu\":\"\",\"events\":\"\"}', '1', '', 'custome', '15989816665f4e8622ed0f7.jpg,15989816745f4e862aafa2e.jpg,15989816915f4e863b0d323.jpg,15989832375f4e8c4546717.jpg,15989832455f4e8c4da1d88.jpg,15989832535f4e8c555c85c.jpg,15989832615f4e8c5d4b42c.jpg,15989832705f4e8c660062e.jpg,15989832775f4e8c6df1553.jpg,159', '{\"image0\":{\"name\":\"15989816665f4e8622ed0f7.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15989816745f4e862aafa2e.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15989816915f4e863b0d323.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15989832375f4e8c4546717.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15989832455f4e8c4da1d88.jpg\",\"t