(1969, 'Yolanda', 'Marín', 'yomabai89+villenzo@gmail.com', '', 'Villenzo Rest & Bar', '', '', '', '1,', '', '+34:642:940818', '', 'yes', 'yes', '1,2,4,6', '1', '19', '11379', '2386', 'Av. Los Ruiseñores, 2, Club Villaverde, Guadacorte', '', 'Villenzo Rest & Bar, ubicado en el Club Villaverde de Guadacorte (Los Barrios), es el lugar ideal donde poder ir y disfrutar de una velada relajada en familia o con amigos.\r\nCocina casera y platos elaborados con ingredientes frescos y de temporada.\r\nDeliciosos cóckteles para terminar de hacer perfecta nuestra visita.\r\nSin problemas de aparcamiento y con todas las facilidades para no tener que pensar en otra cosa que no sea disfrutar el momento y planear nuestra próxima visita.\r\nMuy buen ambiente y trato inmejorable.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15990364795f4f5c3f28584.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"\",\"aboutus_image\":\"1599039624villenzo_about_us.jpg\"}', '1', 'assets/frontend/images/cover-image/restaurant_banner.png', 'defualt', '15990395835f4f685f7e294.jpg,15990396045f4f68742136f.jpg,15990396125f4f687c6e2a2.jpg,15990396235f4f6887a2c56.jpg,162556869160e435b3c7c6f.jpg,162556870160e435bd170b5.jpg,162556870960e435c58b65b.jpg,162556890160e43685d5877.jpg,162556891260e43690144c5.jpg,162', '{\"image0\":{\"name\":\"15990395835f4f685f7e294.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15990396045f4f68742136f.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15990396125f4f687c6e2a2.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15990396235f4f6887a2c56.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"162556869160e435b3c7c6f.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"162556870160e435bd170b5.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"162556870960e435c58b65b.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"162556890160e43685d5877.jpg\",\"