(1973, 'Pepe', 'Sanchís', 'casapepesanchis@gmail.com', '', 'Restaurante Arrocería Casa Pepe Sanchís', '', '', 'https://arroceriacasapepesanchis.es/', '1,', '', '+34:957:412295', '', 'yes', 'yes', '1,2,4,6', '1', '2', '14004', '104', 'Av. Virgen de los Dolores, 2,,', '', 'Con más de 40 años de experiencia en gastronomía valenciana y cordobesa, en nuestra casa, se puede disfrutar de la paella valenciana auténtica, como acredita el Premio a la Mejor Paella Valenciana del Mundo, logrado en el año 2016 en el Concurso Internacional de Paella Valenciana de Sueca.\r\nUna autenticidad y respeto por la genuina elaboración de la paella valenciana, certificada también, con nuestra inclusión en la plataforma ‘Wikipaella’, responsable de reconocer a los restaurantes de todo el mundo que elaboran la tradicional paella valenciana. Córdoba es hoy nuestro hogar y nos sentimos muy orgullosos de pertenecer, como miembro cofrade fundador, a la Cofradía Gastronómica del Salmorejo Cordobés. Por eso, haciendo gala de tal honor, en esta casa, se sirve salmorejo cordobés todo el año.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"16005337125f6634d0e80f6.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"15998359365f5b8f2018c82.jpg\",\"aboutus_image\":\"1599835936sanchis_about_us.jpg\"}', '1', '', 'custome', '15998349615f5b8b51ae2ff.jpg,15998349755f5b8b5f2d637.jpg,15998350445f5b8ba4ee50a.jpg,16005164645f65f1702925a.jpg,16005164785f65f17e3c599.jpg,16005164875f65f187b5a39.jpg,16005164985f65f192a0888.jpg,16005165165f65f1a426287.jpg,16005237915f660e0f24047.jpg,160', '{\"image0\":{\"name\":\"15998349615f5b8b51ae2ff.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15998349755f5b8b5f2d637.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15998350445f5b8ba4ee50a.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"16005164645f65f1702925a.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"16005