(1974, 'Francisco José', 'Méndez', 'espaciozenobia@gmail.com', '', 'Espacio Zenobia', '', '', '', '2,', '', '+34:625:677037', '', 'no', 'no', '1,2,4,6', '1', '4', '21800', '355', 'Av. Centenario,,', '', 'Espacio Zenobia, ubicado en Moguer (Huelva) es un bar de tapas y restaurante de cocina mediterránea y española con un estilo propio que harán de tu visita toda una experiencia gastronómica inolvidable.\r\nDispone de una extensa carta donde no te será nada difícil acertar sea cual sea el plato que elijas.\r\nCon un amplio salón y una fantástica terraza en Espacio Zenobia podrás celebrar cualquier tipo de evento con total tranquilidad y garantía, ya que también disponen de un excelente servicio de catering.\r\nMuy buen ambiente y trato inmejorable.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"15999224265f5ce0fa9dcf4.jpg\",\"cover_image\":\"15999224265f5ce0fa9dff9.jpg\",\"aboutus_image\":\"1599922426zenobia_about_us.jpg\",\"catgory_photo\":\"16001170105f5fd912e25f7.jpg\",\"menu\":\"\",\"events\":\"\"}', '1', '', 'custome', '15999217065f5cde2a5536f.jpg,15999217145f5cde325faef.jpg,15999217225f5cde3a16158.jpg,15999217295f5cde418a112.jpg,15999217385f5cde4a6e2a8.jpg,15999217465f5cde5291ca2.jpg,15999217565f5cde5c881cd.jpg,15999217645f5cde6494d4b.jpg,15999217725f5cde6c0877c.jpg,159', '{\"image0\":{\"name\":\"15999217065f5cde2a5536f.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15999217145f5cde325faef.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15999217225f5cde3a16158.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15999217295f5cde418a112.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15999217385f5cde4a6e2a8.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"15999217465f5cde5291ca2.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"15999217565f5cde5c881cd.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"15999217645f5cde6494d4b.jpg