(1975, 'Aída', 'Aída', 'barraymesa2016@gmail.com', '', 'Barra y Mesa', '', '', '', '1,2', '', '+34:857:806984', '', 'no', 'no', '1,2,4,6', '1', '2', '14008', '104', 'Calle Fray Luís de Granada, 7,,', '', 'Barra y Mesa es un restaurante de Cocina de Mercado, principalmente tradicional y casera, ubicado en Córdoba capital.\r\n\r\nTodos nuestros platos se elaboran con ingredientes de primera calidad, naturales y de temporada, lo que garantiza su frescura.\r\n\r\nMenú diario variable según temporada. \r\n\r\nEn Barra y Mesa se combinan los sabores de la cocina de toda la vida con toques modernos, haciendo un manjar de cada uno de sus platos.\r\n\r\nCon una extensa carta y un amplio salón, trato familiar y muy buen ambiente.\r\n\r\nMuy buena relación calidad-precio.\r\n', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"16006810805f687478b4338.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"16006815215f687631dbfb1.jpg\",\"aboutus_image\":\"1599987304barra_y_mesa_about_us.jpg\"}', '1', '', 'custome', '15999859605f5dd92803b74.jpg,15999859715f5dd9335b626.jpg,15999859835f5dd93f3f502.jpg,15999860055f5dd9552df70.jpg,15999860465f5dd97ee38ba.jpg,15999860695f5dd995b2c66.jpg,16006810405f687450a756b.jpg,16006810495f6874594de39.jpg,16006810695f68746de723f.jpg,160', '{\"image0\":{\"name\":\"15999859605f5dd92803b74.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"15999859715f5dd9335b626.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"15999859835f5dd93f3f502.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"15999860055f5dd9552df70.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"15999860465f5dd97ee38ba.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"15999860695f5dd995b2c66.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"16006810405f687450a756b.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"16006810495f6874594de39.jpg\",\"title\":\"\",\"des\":