(1981, 'Rafael ', 'Conde', 'rafa.conde@arhuagastrotaberna.es', '', 'Arhua Gastrotaberna', '', '', 'https://www.arhuagastrotaberna.es/', '1,', '', '+34:628:189510', '', 'no', 'no', '1,2,4,6', '1', '2', '14006', '104', 'Calle Manuel Cuéllar Ramos, 4,', '', 'Me llamo Rafa Conde. Llevo muchos años cocinando en los mejores restaurantes de Córdoba y del resto de España, y por fin me he animado a crear mi propio restaurante.\r\nSiempre he querido compartir todos mis conocimientos y mis platos, para poder crear toda una experiencia.\r\nAquí crearé platos de cocina de mercado con mucho producto de la zona. También he fusionado nuestra maravillosa cocina árabe con toques exóticos.\r\nEspero compartir cada momento con vosotros y como decimos por aquí: \\\"Mi casa es vuestra casa\\\".\r\nAsí que BIENVENIDOS A VUESTRA CASA.\r\n', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"16003407495f63430ddc0c5.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"16003407495f63430ddc266.jpg\",\"aboutus_image\":\"1600340749arhua_about_us.jpg\"}', '1', '', 'custome', '16003403305f63416a63e9f.jpg,16003403395f6341739a27d.jpg,16003403485f63417ceac57.jpg,16003403585f634186bb8fe.jpg,16003403685f63419049c79.jpg,16003403775f6341997eb10.jpg,16003403875f6341a359265.jpg,16003403995f6341afb8a53.jpg,16003404115f6341bb15860.jpg,160', '{\"image0\":{\"name\":\"16003403305f63416a63e9f.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"16003403395f6341739a27d.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"16003403485f63417ceac57.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"16003403585f634186bb8fe.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"16003403685f63419049c79.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"16003403775f6341997eb10.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"16003403875f6341a359265.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"160034039