(2014, 'Flaca', 'Flaca', 'grupolaflaca@gmail.com', '', 'La Bodega de la Flaca', '', '', '', '1,2', '', '+34:645:499963', '', 'yes', 'yes', '1,2,4,6', '1', '2', '14004', '104', 'Calle Gonzalo Ximénez de Quesada, 17,,', '', 'La Bodega de la Flaca, ubicada en la ciudad de Córdoba, es un restaurante de cocina  mediterránea. El lugar ideal donde picar, tapear, almorzar, cenar, reunirse, hablar, compartir y sobre todo beber y saborear, sin que el tiempo se detenga.....\r\n\r\nComida de elaboración casera, donde todos los platos están preparados con ingredientes de temporada, lo que garantiza su frescura,  y de primera calidad.\r\n\r\nLa combinación perfecta entre lo antiguo y lo moderno.....\r\n\r\n', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"16010255815f6db62dc9d7b.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"16103636965ffc33300311c.jpg\",\"aboutus_image\":\"1601025581flaca_about_us.jpg\"}', '1', 'assets/frontend/images/cover-image/restaurant_banner.png', 'custome', '16010236325f6dae9001bb4.jpg,16010236445f6dae9cee4b2.jpg,16010236635f6daeafc2ba1.jpg,16010236765f6daebcedffd.jpg,16010236865f6daec603f7e.jpg,16010236945f6daecec2742.jpg,16010237025f6daed6d53d1.jpg,16010237125f6daee0a874d.jpg,16010237425f6daefeea860.jpg,160', '{\"image0\":{\"name\":\"16010236325f6dae9001bb4.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"16010236445f6dae9cee4b2.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"16010236635f6daeafc2ba1.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"16010236765f6daebcedffd.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"16010236865f6daec603f7e.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"16010236945f6daecec2742.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"16010237025f6daed6d53d1.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"16010237125f6daee0a874d.jpg\",\"title\":\"\",\"des\":\"\"},\"image8\":{\"name