(2015, 'Manolete', 'Manolete', 'reservas@lacasademanoletebistro.com', '', 'La Casa de Manolete Bistró', '', '', 'https://www.lacasademanoletebistro.com/', '1,', '', '34:661:316044', '', 'yes', 'yes', '1,2,4,6', '1', '2', '14008', '104', 'Av. de Cervantes, nº 10,,', '', 'Nuestro restaurante está ubicado en un lugar privilegiado, en el corazón de la ciudad, en un lugar mágico y lleno de historia.\r\nEl palacete fue construido en el año 1890 por José Ortega y Munilla, escritor y periodista, padre de José Ortega y Gasset, filósofo y ensayista español, exponente principal de la teoría del perspectivismo y de la razón vital  histórica.\r\nNuestros amplios salones y terrazas al igual que la variada carta y nuestros menús de degustación nos convierten en el lugar ideal para cualquier tipo de evento o celebración.\r\nDecoración exquisita, cuidada hasta el último detalle.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"16011942605f7049147171b.jpg\",\"menu\":\"\",\"events\":\"1601194137EVENTOS_La_Casa_de_Manolete.pdf\",\"cover_image\":\"16011936975f7046e1726f7.jpg\",\"aboutus_image\":\"1601193697manolete_about_us.jpg\"}', '1', '', 'custome', '16011927315f70431b2cb52.jpg,16011927415f70432503ad7.jpg,16011927515f70432f0956b.jpg,16011927695f70434101469.jpg,16011927775f704349868a9.jpg,16011927865f70435274d9b.jpg,16011928015f704361c1c49.jpg,16011928125f70436c8ced9.jpg,16011928255f704379c35ff.jpg,160', '{\"image0\":{\"name\":\"16011927315f70431b2cb52.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"16011927415f70432503ad7.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"16011927515f70432f0956b.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"16011927695f70434101469.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"16011927775f704349868a9.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"16011927865f70435274d9b.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\