(2017, 'Tamara', 'Ortega', 'tamaraortegaonetti@hotmail.com', '', 'Mesón San Basilio', '', '', '', '1,', '', '+34:957:297007', '', 'no', 'no', '1,2,4,6', '1', '2', '14004', '104', 'Calle San Basilio, 19,,', '', 'Mesón San Basilio, ubicado en la ciudad de Córdoba, es un restaurante de comida tradicional y mediterránea.\r\nPlatos son caseros preparados con ingredientes frescos y de primera calidad.\r\nProductos locales y de temporada, por lo que se recomienda consultar el menú.\r\n\r\nUn magnífico lugar para compartir tiempo en familia.\r\nMuy buen ambiente y excelente trato al público.\r\n\r\nBuena relación calidad-precio.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"16013109105f7210be7de71.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"16013109105f7210be7e305.jpg\",\"aboutus_image\":\"1601366010basilio_about_us.jpg\"}', '1', '', 'custome', '16013095105f720b466dd30.jpg,16013095205f720b505161e.jpg,16013095385f720b621903a.jpg,16013095605f720b78d5a9f.jpg,16013095695f720b816d1c5.jpg,16013095795f720b8bcec05.jpg,16013095895f720b950ed76.jpg,16013096635f720bdf9595c.jpg,16013096825f720bf2cdaa4.jpg,160', '{\"image0\":{\"name\":\"16013095105f720b466dd30.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"16013095205f720b505161e.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"16013095385f720b621903a.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"16013095605f720b78d5a9f.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"16013095695f720b816d1c5.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"16013095795f720b8bcec05.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"16013095895f720b950ed76.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"16013096635f720bdf9595c.jpg\",\"title\":\"\",\"des\":\"\"},\"image8\":{\"name\":\"16013096825f720bf2cdaa4.jpg\",\"title\":\"\",\"des\":\"\"},\"image9\":{\"name\":\"16013097035f720c07de549.jpg\",\"title\":\