(2018, 'Maria José', 'María José', 'redaccion@mendozacomunicacion.com', '', 'El Aura', '', '', '', '1,', '', '+34:957:100150', '', 'yes', 'yes', '1,2,4', '1', '2', '14004', '104', 'Av. del Aeropuerto, 50,,', '', 'Ubicado en la avenida del Aeropuerto, El Aura ofrece una cocina creativa con una base tradicional. La carta, dividida en tapas y raciones, carta gourmet y postres, cuenta con una gran variedad de platos elaborados y una cuidada presentación para poner a prueba los sentidos de los comensales. Además, el restaurante otorga una especial importancia al vino, con una carta especializada en vinos de la tierra. El Aura cuenta con dos luminosos espacios diferenciados, visualmente conectados por el color blanco: un salón comedor y uno para tapas y aperitivos, a los que se suma la amplia terraza en un barrio moderno de reciente construcción para comidas, cenas y desayunos.  Ideal para la celebrar cualquier tipo de evento.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"16014599625f7456fae09c2.JPG\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"16013976205f736374095f7.jpeg\",\"aboutus_image\":\"1601457878Sal\\u00f3n_21.jpeg\"}', '1', '', 'custome', '16013974105f7362a2b2cab.jpeg,16013976185f7363724a987.jpeg,16013993545f736a3a7b07a.jpg,16013996215f736b456e895.jpg,16014544625f74417ec5343.jpg,16014545495f7441d5b4cd2.jpeg,16014545925f744200801a9.jpg,16014546845f74425c5d08f.jpg,16014547305f74428adc6e4.jpeg', '{\"image0\":{\"name\":\"16013974105f7362a2b2cab.jpeg\",\"title\":\"Patatas Bravas Estilo Chef\",\"des\":\"\"},\"image1\":{\"name\":\"16013976185f7363724a987.jpeg\",\"title\":\"Pulpo Asado\",\"des\":\"con parmentier de piment\\u00f3n de la vera\"},\"image2\":{\"name\":\"16013993545f736a3a7b07a.jpg\",\"title\":\"Alb\\u00f3ndigas de carrillera\",\"des\":\"en su salsa y parmentier de patata violeta\"},\"image3\":{\"name\":\"16013996215f736b456e895.jpg\",\"title\":\"Salm\\u00f3n a baja temperatura