(2021, 'Joaquín', 'Fernández', 'administracion@latabernadealmodovar.com', '', 'La Taberna de Almodóvar', '', '', 'https://www.latabernadealmodovar.com/', '1,', '', '+34:957:940333', '', 'yes', 'yes', '1,2,4', '1', '2', '14001', '104', 'Calle Benito Pérez Galdós, 1,', '', 'En Taberna de Almodóvar encontrarás una cocina Tradicional y diferente. No existe modernidad sin tradición. Respeto por los productos y mano de experta cocinera. Cocinar es hacer trozos de amor comestibles.\r\n\r\nCocina de siempre. La base de la cocina es la gastronomía tradicional cordobesa con toques de modernidad y pequeñas innovaciones, pero sin desdibujar los contornos.\r\n\r\nEspecialidades: Mazamorra de Almodóvar, (Las auténticas) Croquetas de “Almodóvar”, Rabo de toro a la cordobesa y Pulpo a la Brasa.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"16015673795f75fa9362f79.jpg\",\"cover_image\":\"16015673795f75fa936319b.jpg\",\"aboutus_image\":\"1601567379almodovar_about_us.jpg\",\"catgory_photo\":\"\",\"menu\":\"\",\"events\":\"\"}', '1', '', 'custome', '16015669065f75f8ba56711.jpg,16015669195f75f8c746866.jpg,16015669395f75f8db259ff.jpg,16015669485f75f8e451d0d.jpg,16015669585f75f8eea3714.jpg,16015669695f75f8f93fced.jpg,16015669785f75f902adb7d.jpg,16015669895f75f90d3ea69.jpg,16015669985f75f916e8f76.jpg,160', '{\"image0\":{\"name\":\"16015669065f75f8ba56711.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"16015669195f75f8c746866.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"16015669395f75f8db259ff.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"16015669485f75f8e451d0d.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"16015669585f75f8eea3714.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"16015669695f75f8f93fced.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"16015669785f75f902adb7d.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"16015669895f75f90d3