(2023, 'Loli', 'Loli', 'serviloli@hotmail.com', '', 'Servi Loli', '', '', 'https://servi-loli.com/', '3,', '', '+34:957:434625', '', 'no', 'no', '1,2,4', '1', '2', '14012', '104', 'Zona verde, local 11,', '', 'En Servi Loli, ubicado en la ciudad de Córdoba y especialistas en pollos asados, también encontrará magníficos platos caseros elaborados artesanalmente y con productos frescos y locales.\r\n\r\nCon un servicio muy eficiente y un trato inmejorable, en Servi Loli le llevarán también su pedido a domicilio.\r\n\r\nCon una larga trayectoria y la experiencia que les avala, ya que llevan prestando sus servicios desde 1991, hacer su pedido en Servi Loli será todo un acierto.\r\n\r\nMuy buena relación calidad-precio.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"16016487345f77385e356b4.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"16016487345f77385e358ad.jpg\",\"aboutus_image\":\"1601648734serviloli_about_us.jpg\"}', '2', '', 'custome', '16016478115f7734c31c5de.jpg,16016478195f7734cb21462.jpg,16016478265f7734d2a1200.jpg,16016478345f7734da85370.jpg,16016478425f7734e25614e.jpg,16016478515f7734ebc8103.jpg,16016478615f7734f51361a.jpg,16016478685f7734fcda5d3.jpg,16016478765f7735040f31e.jpg,160', '{\"image0\":{\"name\":\"16016478115f7734c31c5de.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"16016478195f7734cb21462.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"16016478265f7734d2a1200.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"16016478345f7734da85370.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"16016478425f7734e25614e.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"16016478515f7734ebc8103.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"16016478615f7734f51361a.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"16016478685f7734fcda5d3.jpg\",\"title\":\"\",\"des\":\"\"},\"image8\":{\"name\":\"16016478765f7735040f31e.jp