(2102, 'Marta', 'Marta', 'martapicnic@gmail.com', '', 'Restaurante Picnic', '', '', '', '1,', '', '+34:958:482233', '', 'no', 'no', '1,2,4', '1', '2', '14001', '104', 'Pasaje Rumasa, Avenida Ronda de los Tejares, 16,,,', '', 'Picnic es un restaurante ubicado en la ciudad de Córdoba especializado en la cocina mediterránea y española.\r\n\r\nTodos sus platos están elaborados con ingredientes frescos y de primera calidad, cuidados hasta el más mínimo detalle.\r\nPasión por la cocina española que se refleja en cada exquisito bocado.\r\n\r\nUna manera distinta de entender la gastronomía cordobesa.\r\n\r\nDispone de una carta muy variada adaptada a todo tipo de paladares.\r\n\r\nMuy buen ambiente y excelente relación calidad-precio.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"16038822675f994d1b07192.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"16038822675f994d1b0762e.jpg\",\"aboutus_image\":\"1603882267picnic_about_us.jpg\"}', '1', '', 'custome', '16038810355f99484b30743.jpg,16038810515f99485b0ed3b.jpg,16038810735f9948717d8ac.jpg,16038810825f99487aee006.jpg,16038810985f99488a5002e.jpg,16038811085f9948949945c.jpg,16038811195f99489f6c6c9.jpg,16038811335f9948ad5e685.jpg,16038811465f9948ba77c98.jpg,160', '{\"image0\":{\"name\":\"16038810355f99484b30743.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"16038810515f99485b0ed3b.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"16038810735f9948717d8ac.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"16038810825f99487aee006.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"16038810985f99488a5002e.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"16038811085f9948949945c.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"16038811195f99489f6c6c9.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"16038811335f9948ad5e685.jpg\",\"title\":\"\",\"des\":\"\"},\"image8\":{\"name\":\"16038811465f9948