(2104, 'Malabar', 'Malabar', 'malabarantequera@gmail.com', '', 'Malabar GastroTaberna', '', '', '', '1,2', '', '+34:623:035395', '', 'no', 'no', '1,2,4', '1', '20', '29200', '2425', 'Alameda de Andalucía, 22,', '', 'Malabar GastroTaberna, ubicado en el centro de Antequera, es un restaurante de cocina mediterránea especializado en tapas.\r\n\r\nCon una carta muy variada y una destacable originalidad en la elaboración de cada uno de sus platos, utilizando siempre ingredientes frescos y de una calidad inmejorable, acudir a Malabar GastroTaberna se convertirá en toda una experiencia gastronómica.\r\n\r\nAmbiente muy relajado y excelente trato al público.\r\n\r\nMuy buena relación calidad-precio.\r\n\r\nMalabar GastroTaberna también ofrece a sus clientes la posibilidad de disfrutar de sus platos en casa, ya que dispone de takeaway.', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"16040526865f9be6cedee48.jpg\",\"cover_image\":\"16040526865f9be6cedf0ba.jpg\",\"aboutus_image\":\"1604052686malabar_about_us.jpg\",\"catgory_photo\":\"\",\"menu\":\"\",\"events\":\"\"}', '1', '', 'custome', '16040488775f9bd7ede7472.jpg,16040488935f9bd7fda5ae3.jpg,16040489045f9bd80892bc5.jpg,16040489165f9bd81432e26.jpg,16040489265f9bd81e7c4f7.jpg,16040489365f9bd828e32e1.jpg,16040489475f9bd833d4616.jpg,16040489565f9bd83c841c4.jpg,16040489655f9bd84552af9.jpg,160', '{\"image0\":{\"name\":\"16040488775f9bd7ede7472.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"16040488935f9bd7fda5ae3.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"16040489045f9bd80892bc5.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"16040489165f9bd81432e26.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"16040489265f9bd81e7c4f7.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"16040489365f9bd828e32e1.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"16040489475f9bd833d4616.jpg\",\"title\":\"\",\"des\":\