(2156, 'Ana', 'Ramón', 'ana.ramon@feroche.es', '', 'Feroche Beach Torrox', '', '', '', '1,3', '', '+34:658:145950', '', 'yes', 'yes', '1,2,4', '1', '20', '29770', '2434', 'Paseo Marítimo Ferrara, s/n', '', 'Feroche Beach Torrox, espectacular gastro ubicado en la playa de Torrox (Málaga), es un restaurante de cocina mediterránea y española que ofrece a sus comensales la oportunidad de disfrutar de sus deliciosos platos, elaborados de manera artesana y utilizando productos frescos y locales, en un relajado ambiente.\r\n\r\nCon una variada carta y una decoración con estilo propio, visitar Feroche Beach Torrox, se convertirá en toda una experiencia gastronómica digna de volver a repetir.\r\n\r\nExcelente trato al público y muy buena relación calidad-precio.\r\n\r\n', '', 'merchant', 2, 'active', '', '', 'active', 'active', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 1, '{\"logo\":\"16049204295fa9246d9bedd.jpg\",\"menu\":\"\",\"events\":\"\",\"cover_image\":\"16049229505fa92e46f220a.jpg\",\"aboutus_image\":\"1604923188feroche_about_us.jpg\"}', '3', '', 'custome', '16049199225fa922727e1c9.jpg,16049199315fa9227bc8637.jpg,16049199415fa922854a02d.jpg,16049199595fa9229745241.jpg,16049199685fa922a0db7e9.jpg,16049199785fa922aadd471.jpg,16049199885fa922b46d698.jpg,16049200085fa922c8ed22b.jpg,16049202195fa9239bbc1df.jpg,160', '{\"image0\":{\"name\":\"16049199225fa922727e1c9.jpg\",\"title\":\"\",\"des\":\"\"},\"image1\":{\"name\":\"16049199315fa9227bc8637.jpg\",\"title\":\"\",\"des\":\"\"},\"image2\":{\"name\":\"16049199415fa922854a02d.jpg\",\"title\":\"\",\"des\":\"\"},\"image3\":{\"name\":\"16049199595fa9229745241.jpg\",\"title\":\"\",\"des\":\"\"},\"image4\":{\"name\":\"16049199685fa922a0db7e9.jpg\",\"title\":\"\",\"des\":\"\"},\"image5\":{\"name\":\"16049199785fa922aadd471.jpg\",\"title\":\"\",\"des\":\"\"},\"image6\":{\"name\":\"16049199885fa922b46d698.jpg\",\"title\":\"\",\"des\":\"\"},\"image7\":{\"name\":\"16049200085fa922c8ed22b.jpg\",\"title\":\"\",\"des\":\"\"},\"i